.Header {
  width: 100%;
  height: 50px;
  position: absolute;

  #Nav {
    display: flex;
    justify-content: flex-end;
  }

  #Btn-mobile {
    margin: 7px;
  }

  &-menu {

    a {
      color: #fff;
      text-decoration: none;

    }
  }



  @media (max-width: 2000px) {
    &-menu {
      position: absolute;
      width: 100%;
      background: $Blue-color;
      text-align: center;
      height: 0px;
      transition: .6s;
      z-index: 1000;
      visibility: hidden;
      overflow-y: hidden;

      li {
        margin-top: 100px;
      }

      a {
        font-size: 30px;
        border-bottom: 2px solid #fff;

      }
    }

    #Nav.active &-menu {
      height: 100vh;
      visibility: visible;

    }

    #Btn-mobile {
      display: flex;
      padding: 8px 13px;
      font-size: 18px;
      border: none;
      background: none;
      cursor: pointer;
      gap: 5px;
      z-index: 1001;
    }

    #Hamburguer {
      display: block;
      color: #fff;
      width: 20px;
      border-top: 2px solid;

      &::after,
      &::before {
        content: '';
        display: block;
        width: 20px;
        height: 2px;
        background: blue;
        margin-top: 5px;
        background: currentColor;
        transition: .3s;
        position: relative;
      }
    }

    #Nav.active #Hamburguer {
      border-top-color: transparent;

      &::before {
        transform: rotate(135deg);
      }

      &::after {
        transform: rotate(-135deg);
        top: -7px;

      }
    }
  }
}

