.Banner {
  width: 100%;
  height: 100%;

  &-title {
    width: 100%;
    height: 100%;
    position: absolute;
    color: #fff;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    text-align: center;
    gap: 40px;

  }

  &-text {
    text-transform: uppercase;
    letter-spacing: 10px;
    font-weight: 700;
    font-size: 48px;
    line-height: 56px;
  }

  p {
    width: 300px;
    font-size: 32px;
    text-align: center;
    font-weight: 700;
    line-height: 40px;
  }

  &-btn {
    padding: 12px 16px;

    background: $Red-color;
    border-radius: 40px;
    border: none;

    color: #fff;
    text-transform: capitalize;
    font-weight: 700;
    font-size: 14px;
    line-height: 20px;
  }



  @media (min-width: 720px) {

    &-title {
      gap: 5px;

    }

    p {
      width: 100%;
    }

    &-btn {
      margin-top: 40px;
    }
  }

}

