.Career {
  width: 100%;
  height: 100%;

  &-title {
    font-size: 20px;
    font-weight: 700;
    margin-left: 6px;
    text-transform: capitalize;
    margin-bottom: 20px;
  }

  &-card {
    padding: 0 10px;
  }


  button.accordion {
    width: 100%;
    border: 1px solid #94A1B1;
    background: #fff;
    padding: 10px;
    border-radius: 8px;

    display: flex;
    justify-content: space-between;
    align-items: center;

    font-size: 16px;
    font-weight: 700;
    color: $Red-color;
    cursor: pointer;
  }

  button.accordion:after {
    content: "\f150";
    font-size: 18px;
    float: right;

  }

  button.accordion.is-open:after {
    content: "\f151";
  }



  .accordion-content {
    color: $Blue-color;
    border: 1px solid #94A1B1;
    padding: 0 20px;

    max-height: 0;
    margin-left: 3px;
    margin-bottom: 10px;
    overflow: hidden;
    transition: 0.4s ease-in-out;
  }

  @media (max-width: 1440px) {}

}

